('Cary Nayda', 'As written by Cary Nayda:  I work extensively with members of the LGBTQIA+ community and have a strong professional interest in this space. I am a part of the queer community and seek to provide services that are accessible for all genders and sexual orientations  - GP referral may be required - Open to youth under 25', 'Mt Barker', 'Allied Health', '', '493437978', -35.0683877, 138.8578012, '26 Hack Street, Mount Barker South Australia, Australia', false, false, false, false, true),
('Dr Paula Stacey-Thomas', '<span>At The Chiropractic Domain, we have a diverse generational health practice and we welcome range of people from various ages and stages of life. We aim to create a safe place where people of diverse culture , sexual orientation, genders and abilities can attend. Chiropractic care can be provided to people who identify as gender diverse or gender neutral, as long as we understand how they would like to be identified.</span>  &nbsp;  Open to Under 18  Open to Over 18  Open to Youth under 25  Family space', 'Goodwood', 'Allied Health', '', '08 8272 4555', -34.9501, 138.5896682, 'The Chiropractic Domain, Goodwood Road, Goodwood SA, Australia', true, true, false, false, false),
