CREATE TABLE doctors (
    id SERIAL PRIMARY KEY,
    doc_name TEXT,
    content TEXT,
    suburb TEXT,
    category TEXT,
    sub_category TEXT,
    phone TEXT,
    lat TEXT,
    lng TEXT,
    address TEXT,
    u18 BOOLEAN,
    o18 BOOLEAN,
    u25 BOOLEAN,
    low_cost_ndis_option BOOLEAN,
    gp_ref_required BOOLEAN
);

